import React from "react";
import {
  Background,
  ModalWrapper,
} from "../../../styledComponents/Dashboard/Modals/createTransactionModal";
const CreateTransaction = ({ state, setState }) => {
  return (
    <div>
      {state.showModal ? (
        <Background>
          <ModalWrapper state={state}>Hello</ModalWrapper>
        </Background>
      ) : null}
    </div>
  );
};

export default CreateTransaction;
